import {
  Column,
  Stack,
  Card,
  Box,
  Columns,
  Inline,
  Placeholder,
  Tiles,
  Text,
  ButtonIcon,
  IconBookmark,
  Button,
} from 'braid-design-system';
import { Component } from 'react';

export class Game extends Component {
  render() {
    return (
      <Columns>
        <Tiles columns={6}>
          <div class='square-element'></div>
        </Tiles>
      </Columns>
    );
  }
}
